import React from "react";
import backgroundimage from "./images/kelli-mcclintock-wBgAVAGjzFg-unsplash.jpg";
import "../style.css";

function Dashboard() {
  return (
    <div className="h-100">
      {/* Full-Screen Background */}
      <div
        className="position-fixed top-0 start-0 w-100 h-100"
        style={{
          backgroundImage: `url(${backgroundimage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      ></div>

      {/* Content Section */}
      <div className="container h-100">
        <div className="row h-100 align-items-center">
          {/* Left Spacer Column */}
          <div className="col-lg-6"></div>

          {/* Right Text Column */}
          <div className="col-lg-6 text-white text-end">
            <h1 className="display-6 mb-3">THE HOME OF MILITARY MENTAL HEALTH</h1>
            <p>
              The Lemich Clinic for Military Mental Health was founded on the
              belief that everyone who serves should have access to high-quality,
              confidential mental health care. We work with service members, military
              spouses, and veterans.
            </p>
            <button className="btn btn-primary mt-3">Learn More</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
